import json

from bython_compiler.create_blueprint import blueprint_to_json, json_to_blueprint

base_blueprint = ""
base_json = blueprint_to_json(base_blueprint)
# save json
with open("temp.json", "w") as file:
    json.dump(base_json, file, indent=4)
print("stop")
with open("output/signal_dict.json", "r") as f:
    signal_dict = json.load(f)
signal_dict = {int(k): v for k, v in signal_dict.items()}
xs = [entity["position"]["x"] for entity in base_json["blueprint"]["entities"]]
xs = list(set(xs))
xs.sort()
print(xs)
x_offset = 242.5
for char in range(40):
    min_x = x_offset + char * 6
    max_x = x_offset + (char + 1) * 6 - 1
    small_signal = signal_dict[char * 2 + 1]
    big_signal = signal_dict[char * 2 + 2]
    s_translator = {
        "wooden-chest": small_signal,
        "iron-chest": big_signal,
    }
    for entity in base_json["blueprint"]["entities"]:
        if min_x <= entity["position"]["x"] <= max_x:
            entity["control_behavior"]["circuit_condition"]["first_signal"]["name"] = s_translator[entity["control_behavior"]["circuit_condition"]["first_signal"]["name"]]
print(json_to_blueprint(base_json))